var loc = {};
d3.csv("data/PotHole-Data.csv", function(rows) {

    // Create nodes for each unique source and target.
    rows.forEach(function(row) {
        if(row.status == "active") {
            if (!loc.hasOwnProperty(row.area)) {
                loc[row.area] = {
                    locations : []
                }
            }
            loc[row.area].locations.push([row.lattitude,row.longitude]);
        }
    });
    console.log(loc);
});





function MapMumbai(_parentElement, _eventHandlerArea, _eventHandlerPot){
    var self = this;
    self.parentElement = _parentElement;
    self.loc = {};
    self.marker = 0;
    self.Gmarker = 0;
    self.isPotHole = false;
    self.eventHandlerArea = _eventHandlerArea;
    self.eventHandlerPot = _eventHandlerPot;
    d3.csv("data/PotHole-Data.csv", function(rows) {


        // Create nodes for each unique source and target.
        rows.forEach(function(row) {
            if(row.status == "active") {
                if (!self.loc.hasOwnProperty(row.area)) {
                    self.loc[row.area] = {
                        locations : []
                    }
                }
                self.loc[row.area].locations.push([parseFloat(row.lattitude),parseFloat(row.longitude)]);
                //console.log(self.loc[row.area]);
            }

        });

        console.log(self.loc);

    });
    //load file data and call initialize
    self.init();
}

var  map



MapMumbai.prototype.circle =  function(mapData ) {
    var self = this;
    console.log("mapdata:",mapData);
    console.log("my-->",map.getZoom());
    if(!self.isPothole) {
        map.setCenter(new google.maps.LatLng(19.055503, 72.829565));
        map.setZoom(14);
        self.layer.remove();
        // Load the station data. When the data comes back, create an overlay.
    }
    else
    {
        if(self.Gmarker != 0)
        {
            self.Gmarker.setMap(null);
        }
        self.Gmarker= new google.maps.Marker({
            map: map,
            draggable: false,
            animation: google.maps.Animation.BOUNCE,
            position: {lat: mapData[0], lng: mapData[1]}
        });
    }
    var overlay = new google.maps.OverlayView();

    // Add the container when the overlay is added to the map.
    overlay.onAdd = function () {
        var circlelayer = d3.select(this.getPanes().overlayMouseTarget).append("div")
            .attr("class", "SvgOverlay");
        //var data  = [[19.066435, 72.838857] , [ 19.067196, 72.83895], [19.071173, 72.837442]];
        console.log("self",self.loc);
        var data = d3.values(self.loc["Bandra"])[0];
        console.log(data);
        // Draw each marker as a separate SVG element.
        // We could use a single SVG, but what size would it have?
        overlay.draw = function () {
            var projection = this.getProjection(),
                padding = 20;
            if(self.marker != 0)
                self.marker.remove();
            self.marker = circlelayer.selectAll("svg").data(data);

            self.marker.each(transform) // update existing markers
                .enter().append("svg:svg")
                .each(transform)
                .attr("class", "marker")

            self.marker.append("svg:circle")
                .attr("r", function(d,i){
                    return "5"

                })
                .attr("cx", function (d, i) {
                    return padding;
                })
                .attr("cy", padding)
                .on("click", function(d,i) { self.isPothole = true; self.circle( d)});


            function transform(d) {
                d = new google.maps.LatLng(d[0], d[1]);
                d = projection.fromLatLngToDivPixel(d);
                return d3.select(this)
                    .style("left", (d.x - padding) + "px")
                    .style("top", (d.y - padding) + "px");
            }
        };
    };

    // Bind our overlay to the map?
    overlay.setMap(map);
}
